import React from 'react';
import './style.css';

export const MovieCard = (props) => {
    return(
        <div className="card">
            <div className="image">
                <img src = {props.url} alt=""/>
            </div>
            <div className="detail">
                <h1>{props.name}</h1>
                <p>{props.discription}</p>
            </div>
        </div>
    );
}
